import datetime
from typing import List, Dict, Optional
import sqlite3
from abc import ABC, abstractmethod
import requests
import json
import hashlib
import time

# Database setup
DB_NAME = "data_system.db"

def init_db():
    conn = sqlite3.connect(DB_NAME)
    cursor = conn.cursor()

    cursor.execute('''
    CREATE TABLE IF NOT EXISTS submissions (
        id INTEGER PRIMARY KEY,
        data TEXT,
        submission_date TEXT,
        status TEXT,
        is_fabs BOOLEAN,
        year INTEGER
    )
    ''')

    cursor.execute('''
    CREATE TABLE IF NOT EXISTS validation_rules (
        id INTEGER PRIMARY KEY,
        rule_name TEXT,
        rule_logic TEXT,
        effective_date TEXT
    )
    ''')

    cursor.execute('''
    CREATE TABLE IF NOT EXISTS ui_changes (
        id INTEGER PRIMARY KEY,
        request_text TEXT,
        version_round INTEGER,
        status TEXT,
        request_date TEXT
    )
    ''')

    cursor.execute('''
    CREATE TABLE IF NOT EXISTS user_tests (
        id INTEGER PRIMARY KEY,
        test_scenario TEXT,
        scheduled_time TEXT,
        participants TEXT,
        status TEXT
    )
    ''')

    cursor.execute('''
    CREATE TABLE IF NOT EXISTS d_files (
        id INTEGER PRIMARY KEY,
        agency TEXT,
        data_hash TEXT,
        creation_date TEXT,
        data TEXT,
        cache_key TEXT UNIQUE
    )
    ''')

    conn.commit()
    conn.close()

init_db()

# Base classes
class DataProcessor:
    def __init__(self):
        self.conn = sqlite3.connect(DB_NAME)

    def __del__(self):
        self.conn.close()

