# Data Management functionality
class SubmissionManager(DataProcessor):
    def update_fabs_status(self, submission_id: int, new_status: str):
        cursor = self.conn.cursor()
        cursor.execute(
            "UPDATE submissions SET status = ? WHERE id = ? AND is_fabs = 1",
            (new_status, submission_id)
        )
        self.conn.commit()
        return cursor.rowcount

# Validation functionality
class ValidationManager(DataProcessor):
    def update_validation_rule(self, rule_name: str, rule_logic: str):
        cursor = self.conn.cursor()
        cursor.execute(
            "INSERT OR REPLACE INTO validation_rules (rule_name, rule_logic, effective_date) VALUES (?, ?, ?)",
            (rule_name, rule_logic, datetime.datetime.now().isoformat())
        )
        self.conn.commit()
        return cursor.lastrowid

# Data Analysis functionality
class DFileGenerator:
    def __init__(self):
        self.cache = {}
        self.conn = sqlite3.connect(DB_NAME)

    def generate_d_file(self, agency: str, use_cache: bool = True) -> Dict:
        cache_key = hashlib.md5(agency.encode()).hexdigest()

        if use_cache:
            cursor = self.conn.cursor()
            cursor.execute("SELECT data FROM d_files WHERE cache_key = ?", (cache_key,))
            cached = cursor.fetchone()
            if cached:
                return json.loads(cached[0])

        # Simulate combining FABS/FPDS data
        combined_data = {
            "agency": agency,
            "fabs_data": self._get_fabs_data(agency),
            "fpds_data": self._get_fpds_data(agency),
            "generated_at": datetime.datetime.now().isoformat()
        }

        # Cache the result
        cursor = self.conn.cursor()
        cursor.execute(
            "INSERT OR REPLACE INTO d_files (agency, data_hash, creation_date, data, cache_key) VALUES (?, ?, ?, ?, ?)",
            (agency, hashlib.md5(json.dumps(combined_data).encode()).hexdigest(),
             datetime.datetime.now().isoformat(), json.dumps(combined_data), cache_key)
        )
        self.conn.commit()

        return combined_data

    def _get_fabs_data(self, agency: str) -> List[Dict]:
        cursor = self.conn.cursor()
        cursor.execute("SELECT data FROM submissions WHERE is_fabs = 1 AND data LIKE ?", (f'%{agency}%',))
        return [json.loads(row[0]) for row in cursor.fetchall()]

    def _get_fpds_data(self, agency: str) -> List[Dict]:
        cursor = self.conn.cursor()
        cursor.execute("SELECT data FROM submissions WHERE is_fabs = 0 AND data LIKE ?", (f'%{agency}%',))
        return [json.loads(row[0]) for row in cursor.fetchall()]

# UI Team functionality
class UIChangeManager(DataProcessor):
    def submit_change_request(self, request_text: str, version_round: int = 1):
        cursor = self.conn.cursor()
        cursor.execute(
            "INSERT INTO ui_changes (request_text, version_round, status, request_date) VALUES (?, ?, ?, ?)",
            (request_text, version_round, "Pending", datetime.datetime.now().isoformat())
        )
        self.conn.commit()
        return cursor.lastrowid

    def get_change_requests(self, version_round: Optional[int] = None) -> List[Dict]:
        cursor = self.conn.cursor()
        if version_round:
            cursor.execute(
                "SELECT id, request_text, version_round, status, request_date FROM ui_changes WHERE version_round = ?",
                (version_round,)
            )
        else:
            cursor.execute("SELECT id, request_text, version_round, status, request_date FROM ui_changes")

        return [
            {
                "id": row[0],
                "request_text": row[1],
                "version_round": row[2],
                "status": row[3],
                "request_date": row[4]
            }
            for row in cursor.fetchall()
        ]

