# Data Engineering functionality
class HistoricalDataLoader(DataProcessor):
    def load_historical_fabs(self, data: List[Dict], derive_fields: bool = True):
        cursor = self.conn.cursor()

        for record in data:
            if derive_fields:
                record = self._derive_fields(record)

            cursor.execute(
                "INSERT INTO submissions (data, submission_date, status, is_fabs, year) VALUES (?, ?, ?, ?, ?)",
                (json.dumps(record), datetime.datetime.now().isoformat(), "Processed", True, record.get("year", 0))
            )

        self.conn.commit()
        return len(data)

    def _derive_fields(self, record: Dict) -> Dict:
        record["derived_timestamp"] = datetime.datetime.now().isoformat()
        record["derived_hash"] = hashlib.md5(json.dumps(record).encode()).hexdigest()
        return record

# API Implementations
class APIClient:
    BASE_URL = "http://localhost:8000/api"

    def submit_ui_change(self, request_text: str) -> Dict:
        response = requests.post(
            f"{self.BASE_URL}/ui-changes",
            json={"request_text": request_text}
        )
        return response.json()

    def schedule_user_test(self, test_scenario: str, participants: List[str]) -> Dict:
        response = requests.post(
            f"{self.BASE_URL}/user-tests",
            json={
                "test_scenario": test_scenario,
                "participants": participants,
                "scheduled_time": datetime.datetime.now().isoformat()
            }
        )
        return response.json()

    def get_d_file(self, agency: str) -> Dict:
        response = requests.get(f"{self.BASE_URL}/d-files/{agency}")
        return response.json()

    def load_historical_data(self, data: List[Dict]) -> Dict:
        response = requests.post(
            f"{self.BASE_URL}/historical-data",
            json={"data": data}
        )
        return response.json()

